import React, { useState } from 'react'

function Task() {
    const [text, settext] = useState("");
    const handlechange = (event) => {
        settext(event.target.value);
    }
  return (
      <div>
          <input onChange={handlechange}>Text</input>
          <h3>{text}</h3>
    </div>
  )
}

export default Task
